CREATE TABLE memid_to_regid (
  mem_id text not null,
  reg_id text not null
);


update certificateauthority ca set name = 'CN=' || (select mem_id from memid_to_regid where reg_id = ca.owner) where ca.type != 'ROOT' and exists (select mem_id from memid_to_regid where reg_id = ca.owner);

ALTER TABLE certificateauthority DROP COLUMN owner;

DROP TABLE memid_to_regid;
